import { ProTable } from '@ant-design/pro-components';

const cascaderOptions = [
  {
    field: 'front end',
    value: 'fe',
    language: [
      {
        field: 'Javascript',
        value: 'js',
      },
      {
        field: 'Typescript',
        value: 'ts',
      },
    ],
  },
  {
    field: 'back end',
    value: 'be',
    language: [
      {
        field: 'Java',
        value: 'java',
      },
      {
        field: 'Go',
        value: 'go',
      },
    ],
  },
];

const valueEnumMap = {
  0: 'running',
  1: 'online',
  2: 'error',
};

export type TableListItem = {
  key: number;
  status: string | number;
  cascader: string[];
  treeSelect: string[];
};
const tableListDataSource: TableListItem[] = [];

for (let i = 0; i < 2; i += 1) {
  tableListDataSource.push({
    key: i,
    status: valueEnumMap[Math.floor(Math.random() * 10) % 3],
    cascader: ['fe', 'js'],
    treeSelect: ['fe', 'js'],
  });
}

const valueEnum = {
  all: { text: '\u5168\u90E8', status: 'Default' },
  running: { text: '\u8FD0\u884C\u4E2D', status: 'Processing' },
  online: { text: '\u5DF2\u4E0A\u7EBF', status: 'Success' },
  error: { text: '\u5F02\u5E38', status: 'Error' },
};

const columns: ProColumns<TableListItem>[] = [
  {
    title: '\u72B6\u6001',
    valueType: 'select',
    dataIndex: 'status',
    initialValue: ['all'],
    width: 100,
    valueEnum,
  },
  {
    title: '\u5355\u9009\u72B6\u6001',
    dataIndex: 'status',
    valueType: 'radio',
    initialValue: 'all',
    width: 100,
    valueEnum,
  },
  {
    title: '\u5355\u9009\u6309\u94AE\u72B6\u6001',
    dataIndex: 'status',
    valueType: 'radioButton',
    initialValue: 'all',
    width: 100,
    valueEnum,
  },
  {
    title: '\u591A\u9009\u72B6\u6001',
    dataIndex: 'status',
    initialValue: ['all'],
    width: 100,
    valueType: 'checkbox',
    valueEnum,
  },
  {
    title: '\u7EA7\u8054\u9009\u62E9\u5668',
    key: 'cascader',
    dataIndex: 'cascader',
    width: 100,
    fieldProps: {
      options: cascaderOptions,
      fieldNames: {
        children: 'language',
        label: 'field',
      },
    },
    valueType: 'cascader',
  },
  {
    title: '\u6811\u5F62\u4E0B\u62C9\u6846',
    key: 'treeSelect',
    dataIndex: 'treeSelect',
    width: 100,
    // request: async () => cascaderOptions,
    fieldProps: {
      options: cascaderOptions,
      fieldNames: {
        children: 'language',
        label: 'field',
      },
      showSearch: true,
      filterTreeNode: true,
      multiple: true,
      treeNodeFilterProp: 'field',
    },
    valueType: 'treeSelect',
  },
  {
    title: '\u65F6\u95F4\u8303\u56F4',
    key: 'dateTimeRange',
    dataIndex: 'dateTimeRange',
    hideInTable: true,
    valueType: 'dateTimeRange',
    fieldProps: {
      // placeholder: []
    },
    renderFormItem: (_, { type, defaultRender }) => {
      if (type === 'form') {
        return null;
      }

      return defaultRender(_);
    },
  },
  {
    title: '\u64CD\u4F5C',
    key: 'option',
    width: 120,
    valueType: 'option',
    render: (_, row, index, action) => [
      <a
        key="a"
        onClick={() => {
          action?.startEditable(row.key);
        }}
      >
        \u7F16\u8F91
      </a>,
    ],
  },
];

export default () => (
  <>
    <ProTable<TableListItem>
      columns={columns}
      request={() => {
        return Promise.resolve({
          data: tableListDataSource,
          success: true,
        });
      }}
      search={{
        defaultCollapsed: false,
        span: 12,
        labelWidth: 'auto',
      }}
      editable={{
        type: 'multiple',
      }}
      rowKey="key"
      headerTitle="\u6837\u5F0F\u7C7B"
    />
  </>
);
